app.controller("myAdsController",["$scope","myAdsFactory","$window",function(o,n,l){o.loadingMyAds=!0,n.getMyAds().then(n=>{o.loadingMyAds=!1,o.myAds=n}),o.onUnpublish=(d=>{!0===confirm("Are you sure?")&&(o.loadingUnpublish=!0,n.unpublish(d).then(n=>{o.loadingUnpublish=!1,1===n.status&&l.location.reload()}))}),o.update=(d=>{o.loading=!0,n.update(d).then(()=>{o.loading=!1,l.location.reload()})})}]);